tables.table_schema:
CREATE TABLE EnergyEfficiency (
    id INT PRIMARY KEY,
    location VARCHAR(255),
    efficiency_rating DECIMAL(5, 2),
    efficiency_metrics VARCHAR(255)
);

CREATE TABLE energy_consumption (
  id INT PRIMARY KEY,
  shipment_id INT,
  timestamp TIMESTAMP,
  energy_usage DECIMAL
);

CREATE TABLE supply_chain_optimization (
  id INT PRIMARY KEY,
  shipment_id INT,
  optimization_strategy TEXT,
  optimization_result TEXT
);

CREATE TABLE energy_sources (
  id INT PRIMARY KEY,
  source_name TEXT,
  source_type TEXT,
  energy_units DECIMAL
);

CREATE TABLE energy_optimization_log (
  id INT PRIMARY KEY,
  timestamp TIMESTAMP,
  strategy_used TEXT,
  optimization_time DECIMAL
);
